import { ThemeContext } from "../context/ThemeContext";
import { useContext } from "react";
import "../global.css";
import react from "../imgs/icons/react";
export default function Skills() {
	const theme = useContext(ThemeContext);
	console.log(theme.theme);
	return (
		<div className="skillsContainer">
			<div className="skillsTitle">
				<h1>Skills</h1>
				<img src={react} alt="" />
				<span className="skillsCustom1"></span>
				<span className="skillsCustom2"></span>
			</div>
			<div className="skillsIcons">
				<div className="skillsIcon1">JAVASCRIPT</div>
				<div className="skillsIcon2">REACT</div>
				<div className="skillsIcon3">REDUX</div>
				<div className="skillsIcon4">NODE</div>
				<div className="skillsIcon5">VS CODE</div>
				<div className="skillsIcon6">FIGMA</div>
			</div>
		</div>
	);
}
